import { Component } from "../../core/component";
import { IMouseDown, IMouseUp, IMouseMove, ITouchDown, ITouchUp, ITouchMove } from "./interaction_interfaces";
import { GameObject } from "../../core/game_object";
import MouseData from "../input_data_classes/mouse_data";
import TouchData from "../input_data_classes/touch_data";
import Input from "../input";

export class InteractionHandlerComponent extends Component {
    protected _type = "InteractionHandler";
    private _mouseEvents: Map<string, (event: MouseData) => void> = new Map();
    private _clickables = new Array<IMouseDown>();
    private _releasables = new Array<IMouseUp>();
    private _hoverables = new Array<IMouseMove>();

    private _touchEvents: Map<string, (event: TouchData) => void> = new Map();
    private _touchables = new Array<ITouchDown>();
    private _touchreleasables = new Array<ITouchUp>();
    private _touchmoveables = new Array<ITouchMove>();

    constructor(gameObject: GameObject){
        super(gameObject);
        
        let mouseDown = (event: MouseData) => this.onMouseDown(event);
        let mouseUp = (event: MouseData) => this.onMouseUp(event);
        let mouseMove = (event: MouseData) => this.onMouseMove(event);

        let touchDown = (event: TouchData) => this.onTouchDown(event);
        let touchUp = (event: TouchData) => this.onTouchUp(event);
        let touchMove = (event: TouchData) => this.onTouchMove(event);

        //
        this._mouseEvents.set('mouseDown', mouseDown);
        this._mouseEvents.set('mouseUp', mouseUp);
        this._mouseEvents.set('mouseMove', mouseMove);

        this._touchEvents.set('touchDown', touchDown);
        this._touchEvents.set('touchUp', touchUp);
        this._touchEvents.set('touchMove', touchMove);

        //
        Input.mouse.onMouseDownEvent.sub(mouseDown);
        Input.mouse.onMouseUpEvent.sub(mouseUp);
        Input.mouse.onMousemoveEvent.sub(mouseMove);

        Input.touch.onTouchStartEvent.sub(touchDown);
        Input.touch.onTouchEndEvent.sub(touchUp);
        Input.touch.onTouchMoveEvent.sub(touchMove);

    }

    public BindMouseDown(clickable: IMouseDown): void{
        this._clickables.push(clickable);
    }

    public BindMouseUp(releasable: IMouseUp): void{
        this._releasables.push(releasable);
    }

    public BindMouseMove(hoverable: IMouseMove): void{
        this._hoverables.push(hoverable);
    }

    public BindTouchDown(touchable: ITouchDown): void {
        this._touchables.push(touchable);
    }

    public BindTouchUp(touchreleasable: ITouchUp): void {
        this._touchreleasables.push(touchreleasable);
    }

    public BindTouchMove(touchmoveable: ITouchMove): void{
        this._touchmoveables.push(touchmoveable);
    }

    public onMouseDown(event: MouseData): void{
        for(let i = this._clickables.length - 1; i > -1; i--){
            this._clickables[i].onMouseDown(event);
        }
    }

    public onMouseUp(event: MouseData): void{
        for(let i = this._releasables.length - 1; i > -1; i--){
            this._releasables[i].onMouseUp(event);
        }
    }

    public onMouseMove(event: MouseData): void{
        for(let i = this._hoverables.length - 1; i > -1; i--){
            this._hoverables[i].onMouseMove(event);
        }
    }

    public onTouchDown(event: TouchData): void {
        for(let i = this._touchables.length - 1; i > -1; i--){
            this._touchables[i].onTouchDown(event);
        }
    }

    public onTouchUp(event: TouchData): void {
        for(let i = this._touchreleasables.length - 1; i > -1; i--){
            this._touchreleasables[i].onTouchUp(event);
        }
    }

    public onTouchMove(event: TouchData): void {
        for(let i = this._touchmoveables.length - 1; i > -1; i--){
            this._touchmoveables[i].onTouchMove(event);
        }
    }

    Destroy(): void{
        for(let [, value] of this._mouseEvents){
            Input.mouse.onMouseDownEvent.unsub(value);
            Input.mouse.onMouseUpEvent.unsub(value);
            Input.mouse.onMousemoveEvent.unsub(value);
        }

        for(let [, value] of this._touchEvents){
            Input.touch.onTouchStartEvent.unsub(value);
            Input.touch.onTouchEndEvent.unsub(value);
            Input.touch.onTouchMoveEvent.unsub(value);
        }
        super.Destroy();
    }
}
